Reducers
* switch statement (check actiontype)
* calls relevant update function where state is updated from passed in (action) object
it triggers a state change event to all your react components that are listening to it. All components listening to the changed state get re-rendered, with the new version of the state, thereby updating your DOM
import * as actionTypes from '../actions/actionsTypes';
import { updateObject } from '../../shared/utility';
const initialState = {
hideToolbar: false,
};
const shouldHideToolbar = (state, action) => {
return updateObject(state, { hideToolbar: action.show });
};
//reducer
const reducer = (state = initialState, action) => {
switch (action.type) {
case actionTypes.SHOW_TOOLBAR:
return shouldHideToolbar(state, action);
default:
return state;
}
};
export default reducer;

Containers (Stateful components)
The connect() function connects a React component to a Redux store.
It provides its connected component with the pieces of the data it needs from the store, and the functions it can use to dispatch actions to the store.
mapStateToProps gives you access to state in reducer
mapDispatchToProps gives you access to dispatch
and has functions you can call in mapDispatchToProps from the container eg. somewhere in container, call hideToolbar(true)
import * as actions from '../../store/actions/index';
import { connect } from 'react-redux';
...
const mapStateToProps = (state) => {
return {
storedPhonebook: state.profile.phoneBook,
isLoading: state.profile.loading,
activeProfile: state.profile.activeProfile,
};
};
const mapDispatchToProps = (dispatch) => {
return {
onFetchProfile: (id) => {
dispatch(actions.processFetchProfile(id));
},
hideToolbar: (bool) => {
dispatch(actions.hasToolbar(bool));
},
};
};
export default connect(mapStateToProps, mapDispatchToProps)(ProfileRead);
